$(document).ready(function(){$(document).ready(function(){$.widget("ui.autocomplete",$.ui.autocomplete,{options:{renderItem:null,renderMenu:null},_renderItem:function(e,n){return $.isFunction(this.options.renderItem)?this.options.renderItem(e,n):this._super(e,n)},_renderMenu:function(e,n){$.isFunction(this.options.renderMenu)&&this.options.renderMenu(e,n),this._super(e,n)}});var e=function(e){$(e).addClass("dropdown-menu")},n=function(e,n){return $("<li>").append($('<a href="/portfolio?id='+n.id+'">').html("<span class='search_float_right'><img src='"+n.img+"'></span> "+n.first+"  "+n.last+" ")).append("<span class='search_username'><br /> "+n.username+"</span>").appendTo(e)};$(".search_field").autocomplete({source:"/search_suggestions",renderMenu:e,renderItem:n})})});